'use strict';
let MessageType = require('./MessageType.js');
class MdtConnectedMessage {
    streamIds;
    forceReset;
    static create(streamIds, forceReset) {
        let result;
        result = new MdtConnectedMessage();
        result.streamIds = streamIds;
        result.forceReset = forceReset;
        return result;
    }
    getStreamIds() {
        return this.streamIds;
    }
    getForceReset() {
        return this.forceReset;
    }
    getType() {
        return MessageType.MdtConnected;
    }
}
module.exports = MdtConnectedMessage
